import React, { Component } from "react";

class List extends Component {
  constructor() {
    super();
    this.state = {
      loading: false,
      users: []
    };
  }

  render() {
    return (
      <table id="list">
        <thead>
          <tr className="head-row">
            <th>First name</th>
            <th>Last name</th>
            <th>House</th>
            <th>Status</th>
            <th>Blood</th>
            <th>Details</th>
          </tr>
        </thead>
        <tbody>
          <ListItem user={this.props.user} />
        </tbody>
      </table>
    );
  }
}

export default List;
